package service;

public class CalculadoraBasicaServiceImpl implements CalculadoraBasicaService{

	@Override
	public int sumar(int a, int b) {
		// TODO Auto-generated method stub
		return a+b;
	}

	@Override
	public int restar(int a, int b) {
		// TODO Auto-generated method stub
		return a-b;
	}

}
